      body {
    display: flex;
    flex-direction: column;
    height: 100vh;
    background: white;
    font-family: "IBM Plex Sans", "Helvetica Neue", Helvetica, Arial, sans-serif;
    line-height: 1.5;
      }
      nav {
    display: flex;
    align-items: center;
    position: fixed;
    top: 0;
    left: 0;
    height: 3rem;
    width: 100vw;
    z-index: 1;
    background-color: #1b2834;
      }
