    justify-content: center;
    align-items: center;
    position: absolute;
    top: 0;
    right: 0;
    left: 0;
    bottom: 0;
    height: 100vh;
    width: 100vw;
    padding: 1rem;
    background-color: rgba(23, 23, 23, 0.5);
    }
    .form {
    position: relative;
    display: flex;
    flex-direction: column;
    height: 100%;
    max-height: 24rem !important;
    max-width: 36rem;
    width: 100%;
    background: rgb(243, 243, 243);
    border-radius: 0.25rem;
    }
    .form__body {
    display: flex;
    flex-direction: column;
    padding: 1rem;
    }
    .errorNotification {
    bottom: 4rem;
    padding-bottom: 0 !important;
